import React from "react";
import "./BlogsContainer.scss";

const BlogsContainer = () => {
  return (
    <div className="blogs-container">
      <p className="blogs-container-title">Our Blog</p>

      <div className="container"></div>
    </div>
  );
};

export default BlogsContainer;
